import React from "react";

const Mainpage = () => (
  <div>
    <div
      className="main-image"
      style={{
        backgroundImage: `url(${"https://i.ibb.co/HX1vCzS/main-page.jpg"})`,
      }}
    ></div>
  </div>
);

export default Mainpage;
